// SPDX-License-Identifier: MIT
pragma solidity 0.6.12;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/proxy/Initializable.sol";
import "./FwarMarketStorage.sol";


interface ISeed {
    function getSeed() external returns(uint256);
}

interface IFwarBlackList {
    function isBlackList(address _address) external view returns (bool);
}

interface IFwarMining {
    function getStakingNFT(uint _nftId) external view returns (uint);
}

contract FwarMarketDelegate is Initializable, AccessControl, FwarMarketStorage {
    using SafeERC20 for IERC20;

    event CreateOrder(address _owner, address indexed _nftContract, uint[] _nftIds, address indexed _token, uint indexed _price, uint _expiration, uint _orderId);

    event CancelOrder(address indexed _owner, address indexed _nftContract , uint indexed _orderId, uint[] _nftIds);

    event BuyOrder(uint indexed _orderId, uint[] _nftIds, address indexed _buyer, address _seller, address _nftContract, address _token, uint indexed price);

    event CleanOrder(uint indexed _orderId, uint[] _nftIds, address indexed _seller, address _nftContract, address _token, uint indexed price);

    function initialize(address admin, address _seedAddress, address _blackListAddress, address _fwarMiningAddress) public payable initializer {
        _setupRole(DEFAULT_ADMIN_ROLE, admin);
        maxExpirationTime = 14 days;
        minExpirationTime = 1 days;
        seedAddress = _seedAddress;
        blackListAddress = _blackListAddress;
        fwarMiningAddress = _fwarMiningAddress;
    }

    function configExpiration(uint _minExpirationTime, uint _maxExpirationTime) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        maxExpirationTime = _maxExpirationTime;
        minExpirationTime = _minExpirationTime;
    }

    function configFee(address _feeTo, uint _feeRate) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        feeTo = _feeTo;
        feeRate = _feeRate;
    }

    function setNFTAdd(address _nftAddress, uint _value) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        nftAdds[_nftAddress] = _value;
    }

    function setTokenAdd(address _tokenAddress, uint _value) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        tokenAdds[_tokenAddress] = _value;
    }

    function getFeeConfig() external pure returns(address feeTo, uint feeRate){
        return (feeTo, feeRate);
    }

    function setSeedAddress(address _seedAddress) external {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        seedAddress = _seedAddress;
    }

    function setBlackListAddress(address _blackListAddress) external{
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        blackListAddress = _blackListAddress;
    }

    function setFwarMiningAddress(address _fwarMiningAddress) external{
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), 'Admin role is required');
        fwarMiningAddress = _fwarMiningAddress;
    }

    function getSellingNFT(uint _nftId, address _nftContract) external view returns (uint) {
        return sellingNFT[_nftId][_nftContract];
    }

    /// @dev createOrder is called by a seller
    /// @param _nftContract is the NFT contract address
    /// @param _nftIds is the array of nftId to sell
    /// @param _expiration is the expiration of order in seconds
    /// @param _token is the pay token contract address for buyer
    /// @param _price is the amount of pay token
    function createOrder(address _nftContract, uint[] calldata _nftIds, address _token, uint _price, uint _expiration) external {
        require(_msgSender() == tx.origin, "FWarMarket: Can not call from contract");
        require(!IFwarBlackList(blackListAddress).isBlackList(_msgSender()), "You are in black list");
        require(IERC721(_nftContract).isApprovedForAll(_msgSender(), address(this)), "Must approve first");
        require(_expiration <= maxExpirationTime, "expiration too large");
        require(_expiration >= minExpirationTime, "expiration too small");
        require(_nftIds.length <= 4, "amount selling nft exceed ");
        require(isValidNFTAddress(_nftContract), "NFT address is not supported");
        require(isValidTokenAddress(_token), "Token address is not supported");
        require(_price != 0, "_price error");

        //Call for generate new seed for random
        ISeed(seedAddress).getSeed();

        for (uint i = 0; i < _nftIds.length; i++) {
            require(_nftIds[i] != 0, "_nftIds error");
            require(IERC721(_nftContract).ownerOf(_nftIds[i]) == _msgSender(), "You have no access");
            require(sellingNFT[_nftIds[i]][_nftContract] == 0, "NFT is selling");
            require(IFwarMining(fwarMiningAddress).getStakingNFT(_nftIds[i]) == 0, "NFT is staking");
            sellingNFT[_nftIds[i]][_nftContract] = _nftIds[i];
        }
        uint orderId = uint(keccak256(abi.encode(_msgSender(), _nftIds, _nftContract, _token)));

        orders[orderId].owner = _msgSender();
        orders[orderId].nftContract = _nftContract;
        orders[orderId].nftIds = _nftIds;
        orders[orderId].token = _token;
        orders[orderId].price = _price;
        orders[orderId].expiration = _expiration;
        orders[orderId].createTime = block.timestamp;

        orderIds.add(orderId);

        emit CreateOrder(_msgSender(), _nftContract, _nftIds, _token, _price, _expiration, orderId);
    }

    /// @param _nftContract is the NFT contract address
    /// @param _nftIds is the array of nftId
    function cancelOrder(uint orderId, address _nftContract, uint[] calldata _nftIds) public {
        require(_msgSender() == tx.origin, "FWarMarket: Can not call from contract");
        address owner = orders[orderId].owner;
        require(owner != address(0), "order not exist");
        require(owner == _msgSender(), "order not yours");
        orderIds.remove(orderId);
        delete orders[orderId];

        //Call for generate new seed for random
        ISeed(seedAddress).getSeed();

        for (uint i = 0; i < _nftIds.length; i++) {
            require(IERC721(_nftContract).ownerOf(_nftIds[i]) == _msgSender(), "nft not yours");
            delete sellingNFT[_nftIds[i]][_nftContract];
        }

        emit CancelOrder(owner, _nftContract,  orderId, _nftIds);
    }

    function buyOrder(uint _orderId) external {
        require(_msgSender() == tx.origin, "FWarMarket: Can not call from contract");
        require(checkOrderValid(_orderId), "order is not valid");
        OrderInfo memory order = orders[_orderId];

        orderIds.remove(_orderId);
        delete orders[_orderId];

        uint total = order.price;
        uint fee = total.mul(feeRate).div(1e12);

        //Call for generate new seed for random
        ISeed(seedAddress).getSeed();

        // transfer fee
        IERC20(order.token).safeTransferFrom(_msgSender(), feeTo, fee);

        IERC20(order.token).safeTransferFrom(_msgSender(), order.owner, order.price.sub(fee));
        for (uint i = 0; i < order.nftIds.length; i++) {
            IERC721(order.nftContract).safeTransferFrom(order.owner, _msgSender(), order.nftIds[i]);
            delete sellingNFT[order.nftIds[i]][order.nftContract];
        }

        emit BuyOrder(_orderId, order.nftIds, _msgSender(), order.owner, order.nftContract, order.token, order.price);
    }

    function orderCount() public view returns (uint) {
        return orderIds.length();
    }

    function getOrderId(uint index) public view returns (uint orderId, bool isValid) {
        uint id = orderIds.at(index);
        return (id, checkOrderValid(id));
    }

    function getOrderById(uint orderId) public view returns (address owner, uint[] memory nftIds, address token, uint price, uint expiration, uint createTime) {
        OrderInfo storage info = orders[orderId];
        owner = info.owner;
        nftIds = info.nftIds;
        token = info.token;
        price = info.price;
        expiration = info.expiration;
        createTime = info.createTime;
    }

    function checkOrderValid(uint orderId) public view returns (bool) {
        OrderInfo storage info = orders[orderId];
        for (uint i = 0; i < info.nftIds.length; i++) {
            if (IERC721(info.nftContract).ownerOf(info.nftIds[i]) != info.owner) {
                return false;
            }
        }

        if (!IERC721(info.nftContract).isApprovedForAll(info.owner, address(this))) {
            return false;
        }

        if (info.createTime + info.expiration < block.timestamp) {
            return false;
        }

        return true;
    }

    function isValidNFTAddress(address _nftAddress) public view returns (bool) {
        require(_nftAddress != address(0), "_nftContract error");

        if(nftAdds[_nftAddress]!=0){
            return true;
        }
    }

    function isValidTokenAddress(address _tokenAddress) public view returns (bool) {
        require(_tokenAddress != address(0), "_token error");

        if(tokenAdds[_tokenAddress]!=0){
            return true;
        }
    }

    function cleanInvalidOrders(int from, int to) public {
        require(to >= from, "to should >= from");
        for (int i=to; i>= from; i--) {
            uint orderId = orderIds.at(uint(i));
            if (!checkOrderValid(orderId)) {
                OrderInfo memory info = orders[orderId];
                orderIds.remove(orderId);
                delete orders[orderId];
                for (uint j = 0; j < info.nftIds.length; j++) {
                    delete sellingNFT[info.nftIds[j]][info.nftContract];
                }
                emit CleanOrder(orderId, info.nftIds, info.owner, info.nftContract, info.token, info.price);
            }
        }
    }

    function cleanInvalidOrder(uint orderId) public {
        if (!checkOrderValid(orderId)) {
            OrderInfo memory info = orders[orderId];
            orderIds.remove(orderId);
            delete orders[orderId];
            for (uint j = 0; j < info.nftIds.length; j++) {
                delete sellingNFT[info.nftIds[j]][info.nftContract];
            }
            emit CleanOrder(orderId, info.nftIds, info.owner, info.nftContract, info.token, info.price);
        }
    }

    function cleanInvalidOrdersAdmin(uint[] calldata _orderIds) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()));

        for (uint i = 0; i < _orderIds.length; i++) {
            uint orderId = _orderIds[i];
            OrderInfo memory info = orders[orderId];
            orderIds.remove(orderId);
            delete orders[orderId];
            for (uint j = 0; j < info.nftIds.length; j++) {
                delete sellingNFT[info.nftIds[j]][info.nftContract];
            }
            emit CleanOrder(orderId, info.nftIds, info.owner, info.nftContract, info.token, info.price);
        }
    }
}

